import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col, Card, Button, Table } from 'react-bootstrap';
//import Cabecalho from '../componentes/cabecalho';
import NavSc from '../componentes/navbar';
import Bootfooter from '../componentes/BSfooter';
import logo5 from '../logo5.png';
import logo6 from '../logo6.png';
import reservasService from '../services/reservasService';
import salasService from '../services/salaService';
import ComboSalas from '../componentes/combosalas';

function Resaervas() {
  
  const [tableData, setTableData] = useState([]);
  
  useEffect(() => {
      async function fetchTableData () {
      
      try {
        
        const response = await reservasService.getReservas();
        //const response = await axios.get('http://localhost:2527/api/salas');
        setTableData(response.data);
      } catch (error) {
        console.error(error);
      }
  
      };
      fetchTableData();
    },[tableData]); 

    async function handlecancel(id) {
      var confirma = window.confirm('Confere?');
      if(confirma){
        try{
            //await axios.delete(`http://localhost:2527/api/deltsalas/${id}`);
            await salasService.deltSalas(id);
            alert('deletado com sucesso!');
        } catch (error){
          console.error(error);
        }
      }
      }
  
  return (    

    <Container fluid>
      <Row>
        <Col xs={12}>
        <NavSc />
        </Col>
      </Row>
     
      
        <Card>
          <Card.Body>
          <Row>
          <Button variant="success" size='lg' type="submit" href='/assalas'>
              incluir
            </Button>
          <Table responsive striped bordered hover variant="light">
          <thead>
            <tr>
              <th>imgLink</th>
              <th>Numero</th>
              <th>Capacidade</th>
              <th>Descrição</th>
              <th>Valor</th>
              <th>Tipo</th>
              <th>Update</th>
              <th>Delete</th>
            </tr>
          </thead>
          <tbody>
          {tableData.map((row, index) => {
              return (
            <tr key={index} data-toogle="tooltip" title={row.imgsala}>
                <td>{row.imagem}</td>
                <td>{row.numero}</td>
                <td>{row.capacidade}</td>
                <td>{row.descricao}</td>
                <td>{row.valor}</td>
                <td>{row.tipo}</td>
                <td><a href={`/assalas/${row._id}`}>
                  <img src={logo5} alt='logo5'></img>
                  </a>
                </td>
                <td><a href='#'>
                  <img src={logo6} alt='logo6' onClick={() => handlecancel(row._id)}></img>
                  </a>
                </td>
            </tr>
          );
          })}
          </tbody>
           </Table>
           <Button variant="dark" size='lg' href='/index'>
              Retornar
            </Button>
            </Row>
           </Card.Body>
        </Card>

      <ComboSalas/>
      
      <Bootfooter/>

    </Container>
  );
}

export default Resaervas;
